import { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";

export default function HouseList({handleChange, formData}) {
    const [rooms, setRoom] = useState([]);
    const navigate = useNavigate();
    console.log("I am in houselist ")
    useEffect(() => {
        fetch('http://localhost:8080/api/room')
            .then(res => {
                if (res.ok) {
                    console.log(res);
                    return res.json();
                } else if (res.status >= 500) {
                    return res
                        .json()
                        .then(error =>
                            Promise.reject(new Error(error.message))
                        );
                } else {
                    // All other errors
                    return Promise.reject(
                        new Error(`Unexpected status code ${res.status}`)
                    );
                }
            })
            .then(data => {
                setGenres(data);
            })
            .catch(error => {
                // console.error(error); // Log for debugging
                navigate('/error', { state: { error } });
            });
    }, []); // This happens every time the component is mounted
    // console.log(genres);
    return (
        <>
            <label htmlFor="genre" className="form-label">
                Genres
            </label>
            <select
                name="rooms"
                id="rooms"
                required
                multiple
                onChange={handleChange}
                className="form-select"
                value={formData.rooms || []}
                >
                
                <option value=''  disabled>
                    [Select Houses]
                </option>
                {rooms.map(house => (
                    <option value={house.roomId} key={house.roomId}>
                        {house.roomName}
                    </option>
                ))}
            </select>
        </>
    );
}
